script: |
  super -f text -I q12073.spq | sort > q12073.out

inputs:
  - name: q12073.spq
    data: |
      SELECT DISTINCT col0 + + - 90 FROM tab2 (FORMAT parquet) WHERE ( + col2 NOT BETWEEN + ( + 53 ) AND + col1 + - + ( ( + - ( col0 ) ) ) * - + col2 );
  - name: tab2

outputs:
  - name: q12073.out
    data: |
      -15
      -26
      -44
